import React, { useState } from 'react';
import { CSSTransition, TransitionGroup } from 'react-transition-group';
import './ToursSection.css';

const ToursSection = () => {
  const [activeIndex, setActiveIndex] = useState(0);

  const tours = [
    {
      id: 1,
      title: "KARACHI",
      image: "https://cdn.britannica.com/85/128585-050-5A1BDD02/Karachi-Pakistan.jpg",
      category: "City",
      description: "Id placerat tacitmates definitionem sea, prima quidam vim no. Duo nobis persecuti cu.",
      price: 54,
      duration: "1h 30min",
      rating: 8.9,
      reviews: 350
    },
    {
      id: 2,
      title: "LAHORE",
      image: "https://cdn.britannica.com/34/74934-050-BCD07187/Lahore-Pakistan.jpg",
      category: "City",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
      price: 60,
      duration: "2h",
      rating: 9.1,
      reviews: 420
    },
    {
      id: 3,
      title: "ISLAMABAD",
      image: "https://cdn.britannica.com/48/134748-050-329B7FB0/Islamabad.jpg",
      category: "City",
      description: "Vivamus luctus urna sed urna ultricies ac tempor dui sagittis.",
      price: 70,
      duration: "2h 30min",
      rating: 9.5,
      reviews: 520
    }
    // Add more tours as needed
  ];

  const handlePrev = () => {
    if (activeIndex > 0) {
      setActiveIndex(activeIndex - 1);
    }
  };

  const handleNext = () => {
    if (activeIndex < tours.length - 1) {
      setActiveIndex(activeIndex + 1);
    }
  };

  return (
    <section className="tours_section">
      <div className="container">
        <div className="main_title">
          <h2>Our Popular Tours</h2>
          <p>Explore the best tours we offer in various cities.</p>
        </div>
        
        <div className="carousel_container">
          <div className="carousel_controls">
            <button onClick={handlePrev} className="prev">&lt;</button>
          </div>
          
          <div className="carousel_inner">
            <TransitionGroup className="carousel_slider">
              {tours.map((tour, index) => (
                <CSSTransition
                  key={tour.id}
                  in={activeIndex === index}
                  timeout={500}
                  classNames="slide"
                  unmountOnExit
                >
                  <div className={`tour_item ${activeIndex === index ? 'active' : ''}`}>
                    <img src={tour.image} alt={tour.title} className="tour_image"/>
                    <div className="tour_content">
                      <h3>{tour.title}</h3>
                      <p>{tour.description}</p>
                      <div className="tour_price">From <strong>${tour.price}</strong> / per person</div>
                      <ul className="tour_info">
                        <li><i className="icon_clock_alt"></i> {tour.duration}</li>
                        <li><i className="icon_like"></i> {tour.rating} ({tour.reviews} reviews)</li>
                      </ul>
                    </div>
                  </div>
                </CSSTransition>
              ))}
            </TransitionGroup>
          </div>

          <div className="carousel_controls">
            <button onClick={handleNext} className="next">&gt;</button>
          </div>
        </div>

        <div className="carousel_indicators">
          {tours.map((_, index) => (
            <span 
              key={index} 
              className={`indicator ${index === activeIndex ? 'active' : ''}`}
              onClick={() => setActiveIndex(index)}
            ></span>
          ))}
        </div>
      </div>
    </section>
  );
};

export default ToursSection;
